import React,{useState} from 'react'
import Review from './Review'

const ReviewLists = () => {
const [review, setReview]=useState([
    { title: "Java", description: "Java edition II" },
    { title: "C++", description: "C++ edition II" },
    { title: "Python", description: "Python edition II" },
    { title: "React", description: "React edition II" }
]);

    return (
        <div className='text-center'>

            <h1>All College Reviews</h1>
            {
                review.length>0? review.map((item)=>(
                    <Review review={item}/>
                )) : "No Review Avialable"
            }
           

        </div>
    )
}

export default ReviewLists
